import React from 'react';
import './App.css';
import Form from './Components/form.jsx'
import Table from './Components/table.jsx'
import Login from './Components/login.jsx'
import Welcome from './Components/welcome.jsx'
import PrivateRoute from './Components/privateRoute.jsx'
import { NavLink, Switch, Route, BrowserRouter as Router } from 'react-router-dom';

import withFirebaseAuth from 'react-with-firebase-auth'
import * as firebase from 'firebase/app';
import 'firebase/auth';
import firebaseConfig from './firebaseConfig';


function App() {
  return (
    <div className="App">
      {/* <div className="Navigation">
       <NavLink to="/prospects">My Prospects</NavLink> 
       <NavLink to="/">Home</NavLink>
       <NavLink to="/contact-a-lawyer">Contact a Lawyer</NavLink>
       </div> */}
  <div className="Routes">
     <Router>
     <Switch>
       <PrivateRoute exact path="/prospects" component={Table} authenticated={this.state.authenticated}/>
       <Route path="/contact-a-lawyer" component={Form} />
       <Route path="/" component={Welcome} /> 
    </Switch>
    </Router>
      </div>
      </div>
  );
};

export default App;
